import './History.css';
import React, {useState} from 'react';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogTitle';
import Button from '@mui/material/Button';


function History(props) {


    const [open, setOpen] = useState(false);


    const handleOpen = () => {
        setOpen(true);
    }


    const handleClose = () => {
        setOpen(false);
    }


    const headers = ['A', 'B', 'Your Answer', 'Correct Answer', 'isCorrect?'];  


    return(
        <div> 
          <button onClick={handleOpen}>Show History</button>
          <Dialog open={open}> 
          <DialogContent>
            <h3>Your recent attempts</h3>        
            <table id="history" > 
                <thead>
                <tr>
                    {headers.map((s, idx) => (<th key={idx}>{s}</th>))}
                </tr>
                </thead>
                <tbody>
                {props.data.map((row,idx) => (
                        <tr key={idx}>
                        <td>{row.factorA}</td>
                        <td>{row.factorB}</td>
                        <td>{row.attempt}</td>
                        <td>{row.answer}</td>
                        {(row.correct)? (<td>true</td>) :
                                    (<td className="incorrect">false</td>)} 
                        </tr>
                    ))}
                </tbody>
            </table>
            <DialogActions>
                <Button onClick={handleClose}>Close</Button>
            </DialogActions>
            </DialogContent>
            </Dialog>
        </div>
    );
}
export default History;
